insert  into `groups`(`id`,`name`,`url`,`title`,`subtitle`,`description`,`permissions`,`created_at`,`updated_at`) values (1,'Docente','docente','QUE ES EL SISEVALDOC: AUTOEVALUACIÓN','Sistema Informático para la Evaluación del Desempeño del Docente de la Universidad Nacional de Pucallpa.','La evaluación de la docencia universitaria es una tarea compleja cuyo objetivo fundamental es la mejora de la calidad de la enseñanza. Para ello, conviene  abarcar todos los puntos de vista relevantes, el de los alumnos y el del propio profesor. Hasta el momento, las  experiencias de evaluación realizadas en la universidad Nacional de Ucayali se han centrado preferentemente en la opinión de los alumnos sobre la actuación del docente en el aula. Esta información es útil y necesaria pero suele ser poco aprovechada para la mejora de la docencia y conviene completarla con otros puntos de vista, en especial el del profesor.',NULL,'2014-04-11 15:13:34','2014-04-11 15:13:34'),(2,'Alumno','alumno','QUE ES EL SISEVALDOC PARA ALUMNOS','Sistema Informático para la Evaluación del Desempeño del Docente de la Universidad Nacional de Pucallpa.','La evaluación del desempeño docente por estudiantes tiene como objetivo valorar las fortalezas y dificultades de las actividades desarrolladas por los docentes en el trabajo formativo; por su naturaleza, constituye una herramienta que proporciona información útil para adecuar las estrategias institucionales de capacitación y desarrollo de competencias de los profesores. Dicho instrumento queda a disposición de los estudiantes para que con su participación responsable y honesta, valoren el desempeño de sus profesores y contribuyan de esta manera a la mejora continua de su educación universitaria',NULL,'2014-04-11 15:13:34','2014-04-11 15:13:34'),(3,'Jefe de Departamento','jefedpto','QUE ES EL SISEVALDOC: POR EL JEFE DE DEPARTAMENTO','Sistema Informático para la Evaluación del Desempeño del Docente de la Universidad Nacional de Pucallpa.','Los Departamentos Académicos son unidades de servicios académicos de la universidad y agrupan a los profesores que cultivan disciplinas afines. El artículo N° 172 de Estatuto de la UNU, establece que los Jefes de Departamentos Académicos evaluarán anualmente los méritos de docente, de acuerdo con el sistema establecido; tomando en cuenta los aspectos de su preparación intelectual, científica y pedagógica, de sus méritos y actitudes.',NULL,'2014-04-11 15:13:34','2014-04-11 15:13:34'),(4,'Administrador','administrador','SISEVALDOC para Administrador','Sistema Informático para la Evaluación del Desempeño del Docente de la Universidad Nacional de Pucallpa.','Commodo id natoque malesuada sollicitudin elit suscipit. Curae suspendisse mauris posuere accumsan massa posuere lacus convallis tellus interdum. Amet nullam fringilla nibh nulla convallis ut venenatis purus sit arcu sociis. Nunc fermentum adipiscing tempor cursus nascetur adipiscing adipiscing. Primis aliquam mus lacinia lobortis phasellus suscipit. Fermentum lobortis non tristique ante proin sociis accumsan lobortis. Auctor etiam porttitor phasellus tempus cubilia ultrices tempor sagittis. Nisl fermentum consequat integer interdum integer purus sapien. Nibh eleifend nulla nascetur pharetra commodo mi augue interdum tellus. Ornare cursus augue feugiat sodales velit lorem. Semper elementum ullamcorper lacinia natoque aenean scelerisque.',NULL,'2014-04-11 15:13:34','2014-04-11 15:13:34');

